INSERT INTO `about_pages` VALUES (1,'Tentang ChatCepat','Platform CRM berbasis AI yang membantu tim sales Anda bekerja lebih efisien, meningkatkan konversi, dan memberikan pengalaman customer terbaik.','ChatCepat adalah solusi CRM modern yang dirancang khusus untuk bisnis Indonesia. Kami menggunakan teknologi AI terdepan untuk membantu Anda mengelola customer relationship dengan lebih baik, mengotomasi tugas-tugas repetitif, dan fokus pada hal yang paling penting - membangun hubungan yang kuat dengan customer Anda.','Menjadi platform CRM berbasis AI terdepan di Indonesia yang membantu setiap bisnis mencapai potensi maksimal mereka melalui teknologi yang mudah digunakan dan terjangkau.','Menyediakan solusi CRM yang powerful namun mudah digunakan, membantu bisnis Indonesia meningkatkan efisiensi sales, dan memberikan pengalaman customer yang luar biasa melalui kekuatan AI.','[{\"title\": \"Inovasi\", \"description\": \"Kami terus berinovasi untuk memberikan solusi terbaik\"}, {\"title\": \"Kemudahan\", \"description\": \"Teknologi canggih yang mudah digunakan untuk semua orang\"}, {\"title\": \"Kemitraan\", \"description\": \"Kami adalah partner kesuksesan bisnis Anda\"}, {\"title\": \"Transparansi\", \"description\": \"Komunikasi yang jujur dan terbuka dengan customer\"}]',NULL,1,'2026-01-08 08:05:50','2026-01-08 08:05:50');
