INSERT INTO `fitur_unggulans` VALUES (1,'MessageSquare','Balas Chat Otomatis','Membantu kamu melakukan automasi chat Non-Stop 24/7. Kamu bisa memilih automasi chat dengan template atau dengan bantuan AI Cerdas dan Humanis yang bisa kamu latih sesuai dengan bidang bisnis yang kamu jalankan.','fitur_unggulan/vBmI7Uni3e85vmP3joxndii9ISfW8j0qXmDdZVxV.png',1,1,'2026-01-08 08:01:01','2026-01-25 10:29:26'),(2,'Bell','Followup Otomatis','Fitur Follow Up akan mengirimkan chat otomatis kepada konsumen setelah jeda tertentu dari chat terakhir. Misalnya, jika chat terakhir terjadi pukul 15.00 dan jeda follow up diatur 60 menit, maka pesan follow up akan terkirim pada pukul 16.00.','fitur_unggulan/MdveY7YlwjOuWs0QPqbcDa6fvTJjeogKoTlKHbPm.png',2,1,'2026-01-08 08:01:01','2026-01-25 10:29:40'),(3,'MessageCircle','WhatsApp Templating','Mau balas chat atau broadcast WhatsApp dengan template pesan yang sudah siapkan? Dengan ChatCepat kamu bisa membuat template pesan dalam bentuk teks, teks + image, teks + video, dokumen, audio, list, button, location, dan polling.','fitur_unggulan/UrRAglZix68SXLmco3725d7RnIXhFNTBnrN7wayB.png',3,1,'2026-01-08 08:01:01','2026-01-25 10:31:57'),(4,'Users','Scraping Contacts','Membantu kamu mengambil kontak dari Google Maps. Sekali klik, boom! semua kontak langsung masuk ke dashboard ChatCepat kamu.','fitur_unggulan/OQV622iH0nAN9JjPiVtk4SWQbLfaKINebKmgVb9N.png',4,1,'2026-01-08 08:01:01','2026-01-25 10:32:23'),(5,'Zap','Integrasi Ongkos Kirim','Pilih ekspedisi yang kamu inginkan untuk memudahkan Chatbot AI mengirimkan estimasi ongkos kirim ketika ada customer yang menanyakan.','fitur_unggulan/o2uApKeiSqH8O6RpHvWYADKkyulxixJ4VDu2Woad.png',5,1,'2026-01-08 08:01:01','2026-01-25 10:32:43');
