INSERT INTO `guide_articles` VALUES (1,1,NULL,'Cara Mengganti Password','cara-mengganti-password','Untuk mengganti password akun Anda, ikuti langkah-langkah berikut:\n\n1. Masuk ke halaman **Dashboard**.\n2. Klik menu profil di pojok kanan atas.\n3. Pilih **Pengaturan Akun**.\n4. Masuk ke tab **Password**.\n5. Masukkan password lama dan password baru Anda.\n6. Klik **Simpan**.',NULL,NULL,NULL,1,1,'2026-01-20 17:30:46','2026-01-20 17:30:46'),(2,1,NULL,'Mengubah Foto Profil','mengubah-foto-profil','Anda dapat mengubah foto profil agar lebih personal.\n\n1. Pergi ke **Pengaturan Akun**.\n2. Pada bagian Foto Profil, klik tombol **Upload**.\n3. Pilih foto dari perangkat Anda (format JPG/PNG, maks 2MB).\n4. Foto akan otomatis diperbarui.',NULL,NULL,NULL,2,1,'2026-01-20 17:30:46','2026-01-20 17:30:46'),(3,2,NULL,'Cara Memulai Broadcast Pertama','cara-memulai-broadcast-pertama','Panduan memulai broadcast:\n\n1. Pastikan Anda sudah menghubungkan nomor WhatsApp di menu **WhatsApp > Sessions**.\n2. Siapkan data kontak di menu **Contact Groups**.\n3. Masuk ke menu **Broadcast > Kirim Broadcast**.\n4. Pilih Device, Group Kontak, dan Template Pesan (opsional).\n5. Tulis pesan Anda atau gunakan template.\n6. Klik **Kirim Broadcast**.',NULL,NULL,NULL,1,1,'2026-01-20 17:30:46','2026-01-20 17:30:46'),(4,2,NULL,'Tips Agar WhatsApp Tidak Terblokir','tips-agar-whatsapp-tidak-terblokir','Agar nomor WhatsApp Anda aman saat melakukan broadcast:\n\n- **Jangan kirim terlalu cepat**: Beri jeda antar pesan (min 5-10 detik).\n- **Gunakan Spintax**: Variasikan isi pesan agar tidak terdeteksi spam.\n- **Hangatkan Nomor**: Jangan langsung kirim ribuan pesan jika nomor baru.\n- **Targetkan Kontak Valid**: Pastikan nomor tujuan aktif dan relevan.',NULL,NULL,NULL,2,1,'2026-01-20 17:30:46','2026-01-20 17:30:46'),(5,3,NULL,'Cara Scrape Google Maps','cara-scrape-google-maps','Dapatkan data bisnis potensial dari Google Maps:\n\n1. Buka menu **Scraper > Google Maps**.\n2. Masukkan kata kunci (misal: \'Cafe di Jakarta Selatan\').\n3. Klik **Mulai Scrape**.\n4. Tunggu proses selesai.\n5. Hasil akan muncul di tabel dan bisa diekspor ke Excel.',NULL,NULL,NULL,1,1,'2026-01-20 17:30:46','2026-01-20 17:30:46'),(6,4,NULL,'Cara Mendapatkan API Key','cara-mendapatkan-api-key','Untuk developer yang ingin mengintegrasikan layanan kami:\n\n1. Masuk ke **Pengaturan Akun > API**.\n2. Klik **Generate New Token**.\n3. Salin token tersebut dan simpan di tempat aman.\n4. Gunakan token ini pada Header Authorization (Bearer Token) setiap request.',NULL,NULL,NULL,1,0,'2026-01-20 17:30:46','2026-01-20 17:30:46'),(7,5,'whatsapp','Setup WhatsApp Cloud API','setup-whatsapp-cloud-api','# Cara Setup WhatsApp Cloud API\n\n## Langkah 1: Buat Meta App\n1. Login ke [Meta for Developers](https://developers.facebook.com)\n2. Klik **My Apps**  **Create App**\n3. Pilih **Business** sebagai type\n4. Isi nama aplikasi dan email\n\n## Langkah 2: Tambah WhatsApp Product\n1. Di dashboard app, klik **Add Product**\n2. Pilih **WhatsApp**  **Set Up**\n3. Pilih Business Portfolio atau buat baru\n\n## Langkah 3: Dapatkan Credentials\n1. Buka **WhatsApp**  **API Setup**\n2. Copy **Phone Number ID** (contoh: 123456789012345)\n3. Copy **Business Account ID** (WABA ID)\n4. Generate **Access Token** (pilih permanent token)\n\n## Langkah 4: Setup Webhook\n1. Buka **WhatsApp**  **Configuration**\n2. Edit **Webhook** URL:\n   - URL: `https://app.balesotomatis.id/api/meta/webhook`\n   - Verify Token: (dari sistem kami)\n3. Subscribe ke field: `messages`, `messaging_postbacks`\n\n## Langkah 5: Input di Sistem\n1. Buka menu **Platforms**  **WhatsApp Business API**\n2. Input **Phone Number ID**\n3. Input **Business Account ID**\n4. Input **Access Token**\n5. Klik **Save** dan **Test Connection**\n\n **Selesai!** WhatsApp sudah siap digunakan.','https://drive.google.com/file/d/1abc123xyz/preview','MessageSquare',NULL,1,1,'2026-01-29 06:25:43','2026-01-29 06:25:43'),(8,5,'whatsapp','Mengirim Pesan WhatsApp','send-whatsapp-message','# Cara Mengirim Pesan WhatsApp\n\n## Via CRM Chat\n1. Buka **CRM Chat App**\n2. Pilih kontak atau klik **New Chat**\n3. Ketik pesan dan tekan **Enter**\n\n## Via Broadcast\n1. Buka **Broadcast WhatsApp**\n2. Pilih kontak atau grup kontak\n3. Tulis pesan atau pilih template\n4. Klik **Send Broadcast**\n\n## Via API\n```bash\ncurl -X POST https://app.balesotomatis.id/api/whatsapp/send \\\n  -H \"Authorization: Bearer YOUR_TOKEN\" \\\n  -H \"Content-Type: application/json\" \\\n  -d \'{\n    \"to\": \"628123456789\",\n    \"message\": \"Hello from API!\"\n  }\'\n```\n\n **Tips:**\n- Gunakan template untuk pesan marketing\n- Maksimal 1000 kontak per broadcast\n- Pesan pertama harus dari user (24 hour window)','https://drive.google.com/file/d/2xyz456abc/preview','Send',NULL,2,1,'2026-01-29 06:25:43','2026-01-29 06:25:43'),(9,5,'instagram','Setup Instagram DM','setup-instagram-dm','# Cara Setup Instagram Direct Message\n\n## Langkah 1: Connect Instagram Business\n1. Login ke [Meta Business Suite](https://business.facebook.com)\n2. Klik **Accounts**  **Instagram accounts**\n3. Connect akun Instagram Business Anda\n\n## Langkah 2: Dapatkan Instagram Account ID\n1. Buka **Meta for Developers**  Your App\n2. Klik **Instagram**  **Basic Display**\n3. Copy **Instagram Account ID**\n\n## Langkah 3: Generate Access Token\n1. Buka **Tools**  **Graph API Explorer**\n2. Pilih aplikasi Anda\n3. Request permissions: `instagram_basic`, `instagram_manage_messages`\n4. Generate Token (pilih permanent)\n\n## Langkah 4: Setup Webhook\n1. Webhook URL sama dengan WhatsApp:\n   - URL: `https://app.balesotomatis.id/api/meta/webhook`\n2. Subscribe to: `messages`, `messaging_postbacks`\n\n## Langkah 5: Input di Sistem\n1. Buka **Platforms**  **DM Instagram**\n2. Input **Account ID**\n3. Input **Access Token**\n4. **Save** dan **Test Connection**\n\n **Done!** Instagram DM ready.','https://drive.google.com/file/d/3def789ghi/preview','Instagram',NULL,3,1,'2026-01-29 06:25:43','2026-01-29 06:25:43'),(10,5,'facebook','Setup Facebook Messenger','setup-facebook-messenger','# Cara Setup Facebook Messenger\n\n## Langkah 1: Buat/Pilih Facebook Page\n1. Buka [Facebook Pages](https://www.facebook.com/pages)\n2. Buat page baru atau pilih existing page\n3. Pastikan Messenger diaktifkan di page\n\n## Langkah 2: Dapatkan Page ID\n1. Buka Page Settings\n2. Klik **About** di sidebar\n3. Scroll ke bawah, copy **Page ID**\n\n## Langkah 3: Generate Page Access Token\n1. Buka **Meta for Developers**  Your App\n2. Klik **Messenger**  **Settings**\n3. Di bagian **Access Tokens**, generate token untuk page Anda\n4. Copy **Page Access Token**\n\n## Langkah 4: Setup Webhook\n1. Di **Messenger Settings**  **Webhooks**\n2. Subscribe page ke webhook:\n   - URL: `https://app.balesotomatis.id/api/meta/webhook`\n   - Verify Token: (dari sistem)\n3. Subscribe to: `messages`, `messaging_postbacks`\n\n## Langkah 5: Input di Sistem\n1. Buka **Platforms**  **Facebook Messenger**\n2. Input **Page ID**\n3. Input **Page Access Token**\n4. **Save** dan **Test Connection**\n\n **Sukses!** Facebook Messenger siap menerima pesan.\n\n **Catatan:**\n- Page Access Token berbeda dengan User Access Token\n- Token bisa expired, generate yang permanent','https://drive.google.com/file/d/4jkl012mno/preview','Facebook',NULL,4,1,'2026-01-29 06:25:43','2026-01-29 06:25:43');
