INSERT INTO `meta_message_templates` VALUES (1,'Sapaan Selamat Datang','greeting','all','Halo {{name}}! \\n\\nSelamat datang di {{business_name}}. Ada yang bisa kami bantu hari ini?','[\"name\", \"business_name\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19'),(2,'Salam Pembuka','greeting','whatsapp','Hai {{name}}, terima kasih sudah menghubungi kami! \\n\\nTim kami akan segera membalas pesan Anda.','[\"name\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19'),(3,'Follow Up Pelanggan','follow_up','all','Hai {{name}},\\n\\nKami ingin menindaklanjuti pesanan Anda #{{order_id}}. Apakah ada yang ingin Anda tanyakan?','[\"name\", \"order_id\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19'),(4,'Reminder Pembayaran','follow_up','whatsapp','Halo {{name}},\\n\\nPembayaran untuk invoice #{{invoice_number}} akan jatuh tempo pada {{due_date}}.\\n\\nTotal: {{amount}}\\n\\nSilakan lakukan pembayaran sebelum tanggal jatuh tempo. Terima kasih! ','[\"name\", \"invoice_number\", \"due_date\", \"amount\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19'),(5,'Promo Produk Baru','marketing','all',' *PROMO SPESIAL* \\n\\nHai {{name}}!\\n\\nKenalan yuk dengan produk terbaru kami: {{product_name}}\\n\\n Diskon {{discount}}% khusus untuk Anda!\\n Hanya Rp {{price}}\\n Promo terbatas sampai {{end_date}}\\n\\nPesan sekarang: {{link}}','[\"name\", \"product_name\", \"discount\", \"price\", \"end_date\", \"link\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19'),(6,'Flash Sale','marketing','whatsapp',' *FLASH SALE ALERT!* \\n\\nHalo {{name}},\\n\\n{{product_name}} DISKON {{discount}}%!\\n\\n~~Rp {{original_price}}~~\\n*Rp {{sale_price}}*\\n\\n Hanya {{hours}} jam lagi!\\n\\n Beli sekarang: {{link}}\\n\\nJangan sampai kehabisan! ','[\"name\", \"product_name\", \"discount\", \"original_price\", \"sale_price\", \"hours\", \"link\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19'),(7,'Konfirmasi Pesanan','support','all',' *Pesanan Diterima*\\n\\nTerima kasih {{name}}!\\n\\nPesanan Anda telah kami terima:\\n\\n Order ID: #{{order_id}}\\n Tanggal: {{date}}\\n Total: {{total}}\\n\\nKami akan segera memproses pesanan Anda. Status pesanan dapat dilihat di: {{tracking_link}}','[\"name\", \"order_id\", \"date\", \"total\", \"tracking_link\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19'),(8,'Update Pengiriman','support','whatsapp',' *Update Pengiriman*\\n\\nHai {{name}},\\n\\nPaket Anda sedang dalam perjalanan!\\n\\n No. Resi: {{tracking_number}}\\n Kurir: {{courier}}\\n Status: {{status}}\\n Estimasi tiba: {{eta}}\\n\\nTracking: {{tracking_link}}','[\"name\", \"tracking_number\", \"courier\", \"status\", \"eta\", \"tracking_link\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19'),(9,'Terima Kasih','support','all',' *Terima Kasih*\\n\\nHai {{name}},\\n\\nTerima kasih sudah berbelanja di {{business_name}}!\\n\\nKami sangat menghargai kepercayaan Anda. Jika ada pertanyaan atau masukan, jangan ragu untuk menghubungi kami.\\n\\n Berikan rating: {{rating_link}}\\n\\nSampai jumpa lagi! ','[\"name\", \"business_name\", \"rating_link\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19'),(10,'Ucapan Ulang Tahun','special','all',' *Selamat Ulang Tahun!* \\n\\nHai {{name}},\\n\\nSelamat ulang tahun yang ke-{{age}}! \\n\\nSebagai kado spesial, kami berikan voucher diskon {{discount}}% khusus untuk Anda.\\n\\nKode: {{voucher_code}}\\nBerlaku sampai: {{expiry_date}}\\n\\nSelamat berulang tahun dan semoga panjang umur! ','[\"name\", \"age\", \"discount\", \"voucher_code\", \"expiry_date\"]','id',1,1,0,'2026-01-29 06:26:19','2026-01-29 06:26:19');
