INSERT INTO `pages` VALUES (1,'Tentang Kami','about','<h2>Tentang ChatCepat</h2><p>ChatCepat adalah platform komunikasi modern yang dirancang untuk memudahkan komunikasi Anda.</p><p>Kami berkomitmen untuk menyediakan layanan terbaik dengan fitur-fitur canggih dan keamanan yang terjamin.</p>','Pelajari lebih lanjut tentang ChatCepat dan misi kami','Tentang Kami - ChatCepat','Pelajari lebih lanjut tentang ChatCepat, platform komunikasi modern untuk semua kebutuhan Anda.','tentang kami, chatcepat, profil perusahaan',1,'2026-01-08 03:10:56','2026-01-08 03:10:56'),(2,'Visi & Misi','vision-mission','<h2>Visi</h2><p>Menjadi platform komunikasi terdepan yang menghubungkan jutaan pengguna di seluruh dunia.</p><h2>Misi</h2><ul><li>Menyediakan layanan komunikasi yang cepat, aman, dan andal</li><li>Terus berinovasi untuk memenuhi kebutuhan pengguna</li><li>Membangun komunitas yang positif dan produktif</li></ul>','Visi dan misi ChatCepat untuk masa depan komunikasi','Visi & Misi - ChatCepat','Visi dan misi ChatCepat dalam menyediakan platform komunikasi terbaik.','visi, misi, chatcepat',1,'2026-01-08 03:10:56','2026-01-08 03:10:56'),(3,'Kebijakan Privasi','privacy','<h2>Kebijakan Privasi</h2><p>Kami menghargai privasi Anda dan berkomitmen untuk melindungi data pribadi Anda.</p><h3>Informasi yang Kami Kumpulkan</h3><p>Kami mengumpulkan informasi yang Anda berikan saat mendaftar dan menggunakan layanan kami.</p><h3>Penggunaan Informasi</h3><p>Informasi Anda digunakan untuk menyediakan dan meningkatkan layanan kami.</p><h3>Keamanan Data</h3><p>Kami menggunakan enkripsi end-to-end untuk melindungi komunikasi Anda.</p>','Kebijakan privasi dan perlindungan data pengguna ChatCepat','Kebijakan Privasi - ChatCepat','Kebijakan privasi ChatCepat mengenai pengumpulan dan penggunaan data pengguna.','kebijakan privasi, privasi, perlindungan data',1,'2026-01-08 03:10:56','2026-01-08 03:10:56'),(4,'Syarat & Ketentuan','terms','<h2>Syarat & Ketentuan</h2><p>Dengan menggunakan ChatCepat, Anda menyetujui syarat dan ketentuan berikut:</p><h3>Penggunaan Layanan</h3><p>Anda harus berusia minimal 13 tahun untuk menggunakan layanan ini.</p><h3>Akun Pengguna</h3><p>Anda bertanggung jawab untuk menjaga keamanan akun Anda.</p><h3>Konten Pengguna</h3><p>Anda bertanggung jawab atas konten yang Anda bagikan melalui platform kami.</p><h3>Larangan</h3><p>Dilarang menggunakan layanan untuk tujuan ilegal atau melanggar hak orang lain.</p>','Syarat dan ketentuan penggunaan layanan ChatCepat','Syarat & Ketentuan - ChatCepat','Syarat dan ketentuan penggunaan layanan ChatCepat.','syarat ketentuan, terms of service, tos',1,'2026-01-08 03:10:56','2026-01-08 03:10:56');
/*!40000 ALTER TABLE `pages` ENABLE KEYS */;
