INSERT INTO `posts` VALUES (1,1,1,'Cara Memulai dengan ChatCepat','cara-memulai-dengan-chatcepat','Panduan lengkap untuk memulai perjalanan Anda dengan ChatCepat','ChatCepat adalah platform komunikasi modern yang memudahkan Anda untuk terhubung dengan tim. Dalam panduan ini, kami akan membahas langkah-langkah dasar untuk memulai menggunakan ChatCepat. Pertama, Anda perlu membuat akun dengan mendaftar menggunakan email. Setelah verifikasi email, Anda dapat langsung mulai menggunakan ChatCepat untuk berkomunikasi dengan tim Anda.','blog/e8a7Pp6fQcHDM3AOiKmxgOiaIQEb0glUsGX3lPII.jpg',NULL,NULL,NULL,0,'published','2026-01-08 03:10:56','2026-01-08 03:10:56','2026-01-27 06:45:24'),(2,2,1,'10 Fitur ChatCepat yang Harus Anda Ketahui','10-fitur-chatcepat-yang-harus-anda-ketahui','Temukan fitur-fitur powerful yang akan meningkatkan produktivitas tim Anda','ChatCepat hadir dengan berbagai fitur yang dirancang untuk meningkatkan produktivitas. Berikut adalah 10 fitur utama: 1) Pesan real-time 2) Grup chat 3) Pengiriman file 4) Voice & Video call 5) Screen sharing 6) Integrasi dengan tools lain 7) Bot automation 8) Search yang powerful 9) Notifikasi yang dapat dikustomisasi 10) End-to-end encryption.','blog/f9nwk0XIkHlWW8lraaSP0EuqDuBw5stNy9r9Jw7w.jpg',NULL,NULL,NULL,1,'published','2026-01-08 03:10:56','2026-01-08 03:10:56','2026-01-31 04:52:20'),(3,3,1,'Update ChatCepat v2.0: Fitur Baru yang Amazing','update-chatcepat-v20-fitur-baru-yang-amazing','ChatCepat v2.0 hadir dengan berbagai fitur baru yang menakjubkan','Kami dengan senang hati mengumumkan peluncuran ChatCepat v2.0! Update ini membawa banyak fitur baru termasuk dark mode, reactions pada pesan, thread untuk diskusi yang lebih terorganisir, dan peningkatan performa yang signifikan. Kami juga telah memperbaiki berbagai bug dan meningkatkan keamanan platform.','blog/K44S1LgSOtcTgNmxMExSiM1GjLgi0H5r5W6FvAcG.jpg',NULL,NULL,NULL,1,'published','2026-01-08 03:10:56','2026-01-08 03:10:56','2026-02-01 06:16:26'),(4,4,1,'Cara Membuat Bot ChatCepat untuk Otomasi','cara-membuat-bot-chatcepat-untuk-otomasi','Tutorial lengkap membuat bot untuk mengotomasi tugas-tugas rutin','Bot di ChatCepat dapat membantu Anda mengotomasi berbagai tugas. Dalam tutorial ini, kami akan memandu Anda membuat bot sederhana yang dapat menjawab pertanyaan umum. Anda akan belajar cara mengatur webhook, membuat command, dan mengintegrasikan bot dengan API ChatCepat. Ikuti langkah-langkah berikut untuk membuat bot pertama Anda.','blog/W8ktqfXdF2f4mKn552NrGkQF6TCmajJNzezjQ0YH.jpg',NULL,NULL,NULL,1,'published','2026-01-08 03:10:56','2026-01-08 03:10:56','2026-01-27 06:45:51'),(5,1,1,'Tingkatkan Keamanan Akun ChatCepat Anda','tingkatkan-keamanan-akun-chatcepat-anda','Tips penting untuk menjaga keamanan akun ChatCepat','Keamanan akun adalah prioritas utama kami. Berikut adalah beberapa tips untuk meningkatkan keamanan akun ChatCepat Anda: 1) Aktifkan two-factor authentication 2) Gunakan password yang kuat dan unik 3) Jangan bagikan kredensial Anda 4) Review devices yang terhubung secara berkala 5) Logout dari session yang tidak digunakan. Dengan mengikuti tips ini, akun Anda akan lebih aman.','blog/u4s4nH60wjipzzs6xRzudzVBEBIUI1EBf8Y00qwA.jpg',NULL,NULL,NULL,0,'published','2026-01-08 03:10:56','2026-01-08 03:10:56','2026-01-27 06:46:00');
